import React from 'react';
import resultsData from './ResultsData';

const Results = ({ resultsData }) => {
  return (
    <div>
      <h3 style={{ color: "#a18525" }}>Fixture</h3>
      <table>
        <thead>
          <tr>
            <th>Round</th>
            <th>Opponent</th>
            <th>Score</th>
            <th>W/L</th>
          </tr>
        </thead>
        <tbody>
          {resultsData.map((result) => (
            <tr key={result.round}>
              <td>{result.round}</td>
              <td>{result.opponent}</td>
              <td>{result.score}</td>
              <td>{result.result}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Results;
